import React from 'react';

const Gallery = () => {
    const parksData = [
        { name: "Nairobi national Part", category: "Wildlife Park", image},
        { name: "Amboseli national Part", category: "Wildlife Park", image},
        { name: "Mount Kenya national Part", category: "Adventure Park", image},
        { name: "Masaai Mara national Part", category: "Mountain Park", image},
    ];

    //group parks by catergory
    const categories = parksData.reduce((acc, park) => {
        if (!acc[park.category]) {
            acc[park.category]
        }
    })
}
